import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the first product card by using a unique product title text
    await page.waitForSelector('text=Apple iPhone 15 Pro Max', { timeout: 5000 });

    // Find the first "Add to Cart" button using XPath for the first visible product card
    const addToCartButton = await page.waitForSelector(
      '//div[contains(@class,"product-card")][.//h3[contains(text(),"Apple iPhone 15 Pro Max")]]//button[contains(., "Add to Cart")]',
      { timeout: 5000 }
    );

    // Take screenshot before clicking Add to Cart
    const step2 = path.join(screenshotsDir, 'step_2_before_add_to_cart.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Click the Add to Cart button
    await addToCartButton.click();

    // Wait for notification of success (look for notification with "added to cart")
    await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Take screenshot after adding to cart
    const step3 = path.join(screenshotsDir, 'step_3_after_add_to_cart.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract cart count from the cart element (look for .cart or #cartCount)
    let cartCount = null;
    try {
      // Try #cartCount first (if present)
      cartCount = await page.$eval('#cartCount', el => el.textContent.trim());
    } catch {
      // Fallback: try to extract number from .cart element text
      try {
        const cartText = await page.$eval('.cart', el => el.textContent);
        const match = cartText.match(/\d+/);
        cartCount = match ? match[0] : null;
      } catch {
        cartCount = null;
      }
    }

    // Optionally, extract notification message
    let notificationText = null;
    try {
      notificationText = await page.$eval('.notification.success', el => el.textContent.trim());
    } catch {
      notificationText = null;
    }

    return {
      success: true,
      action: "Added the first product (Apple iPhone 15 Pro Max) to cart using XPath and verified notification.",
      extractedData: {
        cartCount,
        notificationText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
